import React from "react";
import classes from "./Post.module.css";

function Post(props) {
  return (
    <div className={classes.post}>
      <img src="https://pbs.twimg.com/media/DiaCYMuWkAEClxd.jpg" alt="" />
      {props.message}
      <br />
      <button>Like</button>
      {props.likeCount}
    </div>
  );
}
export default Post;
